[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Cim","category":"page"},{"location":"#Cim","page":"Home","title":"Cim","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Cim.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Cim]","category":"page"},{"location":"#Cim.AbstractContour","page":"Home","title":"Cim.AbstractContour","text":"contours that we plan to support:      1. ellipse      2. circle      3. rectangle (not supported yet)\n\n\n\n\n\n","category":"type"},{"location":"#Cim.quadpts","page":"Home","title":"Cim.quadpts","text":"quadpts\n\nQuadrature points of the trapezoidal rule on the contours.\n\nProperties\n\nN: the number of the quadrature nodes\nnodes: quadrature nodes size of N x 2 \nnodes_prime: derivative of the parametrization size of N x 2\n\n\n\n\n\n","category":"type"},{"location":"#Cim.contr_int-Tuple{Cim.AbstractContour, Function, Any, Int64}","page":"Home","title":"Cim.contr_int","text":"contr_int(ctr, NEP, D, l; n=50, tol=1e-12)\n\nContour integral method to calculate the eigenvalues inside the contour ctr\n\nArugments\n\nctr: the contour\nnep: the nonlinear eigenvalue problem\nD:\nl:\nn: the number of the quadrature points (here we use the trapezoid rule)\ntol: tolerance to determine the number of nonzero singular values\n\nReference\n\nWolf-Jurgen Beyn, An integral method for solving NEPs, Linear Algebra Appl., 2012.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.contr_int_ho-Tuple{Cim.quadpts, Function, Vararg{Int64, 4}}","page":"Home","title":"Cim.contr_int_ho","text":"contr_int_ho()\n\nContour integral method with high-order moments \n\nArguments\n\nIn this function, we follow the notations in Stefan Guttel, Francoise Tisseur, Acta Numerica, 2017\n\nctr:\nnep:\nD:\nr, l: size of the probing matrices\npbar: the number of the moments (for p = 0, ..., pbar)\n\nReference\n\nStefan Guttel, Francoise Tisseur, The NEP, Acta Numerica, 2017.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.get_quadpts-Tuple{Cim.circle, Int64}","page":"Home","title":"Cim.get_quadpts","text":"get_quadpts(ctr::circle, num_quadpts::Int64)\n\nGet the quadrature points on the circle ctr. Here we use trapezoidal rule.\n\nArguments\n\nctr: the contour that we discretize \nnum_quadpts: the number of the quadrature nodes\n\nTODO: note that rectangle is different with ellipse and circle\n\n\n\n\n\n","category":"method"},{"location":"#Cim.get_quadpts-Tuple{Cim.ellipse, Int64}","page":"Home","title":"Cim.get_quadpts","text":"get_quadpts(ctr::ellipse, num_quadpts::Int64)\n\nGet the quadrature points on the ellipse ctr. Here we use trapezoidal rule.\n\nArguments\n\nctr`: the contour that we discretize \nnum_quadpts: the number of the quadrature nodes\n\nTODO: note that rectangle is different with ellipse and circle\n\n\n\n\n\n","category":"method"},{"location":"#Cim.is_inside-Tuple{Any, Cim.ellipse}","page":"Home","title":"Cim.is_inside","text":"is_inside(λ, ctr::ellipse)\nis_inside(λ, ctr::circle)\n\nCheck if the eigenvalue λ is in the contour ctr to avoid  spurious eigenvalues.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.show_contour!-Tuple{Any, Cim.circle}","page":"Home","title":"Cim.show_contour!","text":"show_contour!(ax, ctr::circle)\n\nPlot the contour ctr::circle on Axis ax by using CairoMakie.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.show_contour!-Tuple{Any, Cim.ellipse}","page":"Home","title":"Cim.show_contour!","text":"show_contour!(ax, ctr::ellipse)\n\nPlot the contour ctr::ellipse on Axis ax by using CairoMakie.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.show_eigenvalues!-Tuple{Any, AbstractArray}","page":"Home","title":"Cim.show_eigenvalues!","text":"show_eigenvalues(ax, eigvals::AbstractArray)\n\nPlot the eigenvalues on complex plane on Axis ax by using CairoMakie.\n\n\n\n\n\n","category":"method"},{"location":"#Cim.show_quadpts!-Tuple{Any, Cim.quadpts}","page":"Home","title":"Cim.show_quadpts!","text":"show_quadpts!(ax, pts::quadpts)\n\nPlot the quadrature points pts on Axis ax by using CairoMakie.\n\n\n\n\n\n","category":"method"}]
